// Node IDs array
const nodeIds = dataPoints.map(dp => dp.nodeId);

// Example function to combine High/Low words
function combineWordsExample(high, low, isSigned = false) {
  const lowUnsigned = low & 0xFFFF;
  const highUnsigned = high & 0xFFFF;
  let combined = (highUnsigned << 16) | lowUnsigned;
  if (isSigned && (combined & 0x80000000)) {
    combined -= 0x100000000;
  }
  return combined;
}

// Export everything
module.exports = {
  dataPoints,
  nodeIds,
  combineWordsExample
};